function getRndInteger(min, max) {
    return Math.floor(Math.random() * (max - min + 1) ) + min;
}

function getNextInt(lastInt, max) { //very simple PRNG for repeatable seeds, does not need to be cryptographically secure
    return (2*lastInt % (max-1)) + 1 ;
}

function getSeededInt(seed, max, roundID) {
    let seedValue = seed;
    console.log('nejauša sēkla: ' + seedValue)
    for (let index = 1; index < roundID; index++) {
        seedValue = getNextInt(seedValue, max);
        console.log("In seeded loop, value: " + seedValue);
    }
    return seedValue;
}

function getCoords(game){
    let coords;
    do {
        coords = getLatviaBox(game[1]);
    } while (!point_in_polygon(coords, game[0])); //find coords that lie within the polygon of latvia within a few iterations
    return coords;
}

function getLatviaBox(minMax) { //returns random coordinates in a large box around Latvia, coordinates might not be in Latvia,
    const latitude = parseFloat(getRndInteger(parseInt(minMax[0]*1000000), parseInt(minMax[2]*1000000)))/1000000;
    const longitude = parseFloat(getRndInteger(parseInt(minMax[1]*1000000), parseInt(minMax[3]*1000000)))/1000000;
    const latLongLiteral = {lat: latitude, lng: longitude};
    return latLongLiteral;
}

function point_in_polygon(point, polygon) {
    const num_vertices = polygon.length;
    const x = point.lat;
    const y = point.lng;
    let inside = false;

    let p1 = polygon[0];
    let p2;
    for (let i = 1; i <= num_vertices; i++) {
        p2 = polygon[i % num_vertices];
        if (y > Math.min(p1.lng, p2.lng)) {
            if (y <= Math.max(p1.lng, p2.lng)) {
                if (x <= Math.max(p1.lat, p2.lat)) {
                    const x_intersection = ((y - p1.lng) * (p2.lat - p1.lat)) / (p2.lng - p1.lng) + p1.lat;
                    if (p1.lat === p2.lat || x <= x_intersection) {
                        inside = !inside;
                    }
                }
            }
        }
        p1 = p2;
    }

    return inside;
}

function populatePresetGames() {
    for (let index = 0; index < polygons.length; index++) {
        const polygon = polygons[index];
        const boundaries = minMax[index];
        presetGames[index] = [polygon, boundaries];
    }
}

export async function pregenSingle(game) {
    let store = []; // valid coordinates of one certain gamemode
   // console.log(game);
    for (let locationID = 0; locationID < locationCount; locationID++) {
        store[locationID] = [];
        let coords = getCoords(game);
        store[locationID][0] = coords.lat;
        store[locationID][1] = coords.lng;          
    }
    return store;
}

async function pregenPresetGames(games) {
    for (let gamemodeID = 0; gamemodeID < games.length; gamemodeID++) {
        console.log(gamemodeID);
        presetLocationStore[gamemodeID] = await pregenSingle(games[gamemodeID]);
    }
    console.log("location pregen done");  
}

